import React, { useEffect, useState } from "react";
import axios from "axios";

function PrintScreen(props) {
  const [posts, setPosts] = useState([]);

  useEffect((user) => {
    axios
      .get(`http://localhost:5000/api/booking/sendmsg/${user}`)
      .then((res) => {
        console.log(res);
        setPosts(res.data);
      });
  }, []);

  return (
    <div>
      <h1>Thank You for registering</h1>
      <p>PLease don't forget to carry your photo id and print out copy </p>
    </div>
  );
}

export default PrintScreen;
